export const employees_url = "/api/employees";

export const headEmployeesTableCells = [
  {
    name: "name",
    numeric: false,
    disablePadding: true,
    label: "Name",
  },
  {
    name: "icno",
    numeric: false,
    disablePadding: true,
    label: "I/C No",
  },
  {
    name: "gender",
    numeric: false,
    disablePadding: true,
    label: "Gender",
  },
  { name: "age", numeric: false, disablePadding: true, label: "Age" },
  {
    name: "email",
    numeric: false,
    disablePadding: true,
    label: "Email",
  },
];
